function calculateDominicanPayroll(t){if("number"!=typeof t)return null;const e={threshold:34685,rate:.15,fixedAmount:0},o={threshold:52027.4167,rate:.2,fixedAmount:2601.33},l={threshold:72260.25,rate:.25,fixedAmount:6648},r=.0304*(t>134820?134820:t),n=.0287*(t>269640?269640:t);let h=0;const s=t-(r+n);if(s>e.threshold&&s<=o.threshold){const t=s-e.threshold;h=e.fixedAmount+t*e.rate}else if(s>o.threshold&&s<=l.threshold){const t=s-o.threshold;h=o.fixedAmount+t*o.rate}else if(s>l.threshold){const t=s-l.threshold;h=l.fixedAmount+t*l.rate}const a=r+n+h;return{monthlySalary:t,netMonthlySalary:t-a,sfs:r,afp:n,isr:h,deductions:a}}export default calculateDominicanPayroll;